import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route exact path="/menu" element={<Menu />} />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
